import { url } from "../config.json";

const csdEndpoint = url + "/csdQuery";

export function getCsdMetadataLinks(param) {
  return "links to to the metadata of a range of products";
}

export function getCsdResourceLink(resourceLnk) {
  return "generating the link to a specific product source";
}
